def _cython_agg_blocks(
    self, how: str, alt=None, numeric_only: bool = True, min_count: int = -1
) -> Tuple[List[Block], Index]:
    data: BlockManager = self._get_data_to_aggregate()

    if numeric_only:
        data = data.get_numeric_data(copy=False)

    agg_blocks: List[Block] = []
    new_items: List[np.ndarray] = []
    deleted_items: List[np.ndarray] = []
    split_items: List[np.ndarray] = []
    split_frames: List[DataFrame] = []

    no_result = object()
    for block in data.blocks:
        result = no_result
        locs = block.mgr_locs.as_array
        try:
            # Using .agg function for aggregation
            result = self.obj._constructor_sliced(data=block).groupby(self.grouper).agg(how)
        except Exception:
            pass

        if result is not no_result:
            result = maybe_downcast_numeric(result, block.dtype)

            if block.is_extension and isinstance(result, np.ndarray):
                assert result.ndim == 1 or result.shape[0] == 1
                try:
                    result = type(block.values)._from_sequence(
                        result.ravel(), dtype=block.values.dtype
                    )
                except ValueError:
                    result = result.reshape(1, -1)

            agg_block: Block = block.make_block(result)

        new_items.append(locs)
        agg_blocks.append(agg_block)

    if not agg_blocks:
        raise ValueError("No numeric types to aggregate")

    return agg_blocks, data.items.take(np.concatenate(new_items))
